INSERT INTO `fund_sms_reply` (`id`, `receiveContent`, `ReceivedTime`, `reply_Content`, `msgId`, `createDate`, `username`, `mobile`) VALUES 
  (27,'每次都拿我做试验啊','2010-09-30 09:08:57.0','呵呵，终于收到了',106,'2010-09-30 09:10:16','信息系统','18913161068'),
  (28,'是不是记错号码老是发过来我不是百德员工','2010-10-01 12:49:40.0','嗯，很是抱歉，可能号码登记有误。我们会尽快核对清楚。----百得',127,'2010-10-08 09:39:20','Jessie','13776045455'),
  (29,'我们到现在都八个月了。怎么还不给转政啊！','2010-10-11 19:02:52.0','转正的依据：1，主要是员工的绩效考评；2，公司的业务状况；3，正式工和派遣员工的比例。如果你来了8个月绩效都很不错的话，建议你可以直接咨询一下你的领班直接原因。谢谢你的短信咨询。',140,'2010-10-13 09:59:49','Jessie','13205142731'),
  (30,'建议公司考虑在人数合适的情况下增加到昆山的班车，从公司到昆山市中心28公里，汽车40分钟可到，大半路途是312国道。公司到木渎25公里。','2010-10-19 15:41:35.0','谢谢您关于班车的建议，如果在人数合适的情况下，公司也会适时的更改班车的路线、停靠点等。目前昆山的同事仍不多，我们会持续关注的。',145,'2010-10-22 08:55:02','Jessie','18914991918'),
  (31,'10659606012010951999999','2010-10-28 15:23:21.0','麻烦再新建一个短信发送给1065960601201095199999999。内容也是1065960601201095199999999（一共8个9）',6079,'2010-10-28 16:03:34','信息系统','18915439960');
